import {Container, Button} from '@mui/material/Container';
import Shell from './Shell';

const intro = () => {
    return(
       <Shell heading="Welcome to Coterie" content={
           <Container>
               <h3>Click the button below to get started.</h3>
               <Button></Button>
           </Container>
       }
       />
    )
}

export default intro;
